import React, { Component } from "react";
import { View,Text } from "react-native";



export default class Main extends Component{




    render(){
        return(

            <View style={{
                flexDirection:"row",
                height:"100%"
            }}>
                <View style ={{
                    width:"18%",
                    height:"100%",
                    backgroundColor:"#FF6E70",
                    flexDirection:"column"
                }}>
                    <View style={{width:"100%",height:"5%",backgroundColor:"#880606"}}>

                    </View>
                </View>
                <View style={{
                    width:"82%",
                    height:"100%",
                    backgroundColor:"#ffffff",
                    flexDirection:"column"
                }}>
                    <View style={{width:"100%",height:"5%",backgroundColor:"#880606",justifyContent:"flex-start"}}>
                    <Text style={{fontFamily:"YanoneKaffeesatz",fontWeight:"600",alignSelf:"center",color:"#ffffff",fontSize:22}}>WWW.EMAAN.EDU.PK</Text>

                     </View>
                </View>


            </View>
        );
    }

}
